import {Link} from "react-router-dom";


export const About = () => {
    return (
        <div className="allGames">
        <div className="allGames-info">
            <h2>About us</h2>
            <h6> Post Board was founded in 2020.  We believe games brings happy and joy to people and can bond people together.

                It is our goal to bring different types of games from around the world to our store for you at a great price.

                Post Board hope that you will enjoy and be impressed by the games we carry.  We hope these games will bring happiness and laughter to you and your family. </h6>
        </div>

    </div>
    )
}
